'use strict';

var _modules = require('ui/modules');

var _pipelines_service = require('./pipelines_service');

require('../monitoring');

_modules.uiModules.get('xpack/logstash').factory('pipelinesService', function ($injector) {
  var $http = $injector.get('$http');
  var $window = $injector.get('$window');
  var Promise = $injector.get('Promise');
  var monitoringService = $injector.get('xpackLogstashMonitoringService');
  return new _pipelines_service.PipelinesService($http, $window, Promise, monitoringService);
